import React, { Component } from "react";
import { useEffect } from "react";
import axios from "axios";

const RecipeListTable = () => {
  useEffect(() => {
    axios.get("/recipes").then((res) => {
      console.log(res);
    });
  }, []);
  return <React.Fragment></React.Fragment>;
};

export default RecipeListTable;
